(197, '2022-09-05 10:42:34', 'Articles', '4', NULL, NULL, 'Articles', '4', 'info', 'update', '', '{\"description\":\"<p>Canada will be lifting the last pandemic-era restriction on its immigration services. The country announced that all Express Entry draws will resume starting July 6.<\\/p><p>Canada first imposed restrictions at the start of the pandemic- over 18 months ago.<\\/p><p>Think you check all the immigration boxes? Find out<br><br>Immigration minister Sean Fraser took to Twitter to invite all eligible candidates to apply under<\\/p><p>This comes as a time when the country is already struggling to cope with massive processing delays. According to data shared with ET, Immigration, Refugees and Citizenship Canada (IRCC) had an immigration backlog of almost 2.4 million people, as of June 6, 2022.<br><br>Last month, Canadian Prime Minister Justin Trudeau also announced a new task force to tackle the delays, saying, \\u201cwe know service delays, particularly in recent months, are unacceptable...we will continue to do everything we ca&nbsp;..<br>&nbsp;<\\/p><p><a href=\\\"http:\\/\\/immiyami.mylap\\/pages\\/article-view?page_id=Canada-will-reopen-all-PR-programs-under-Express-Entry-from-July-6-4\\\">http:\\/\\/immiyami.mylap\\/pages\\/article-view?page_id=Canada-will-reopen-all-PR-programs-under-Express-Entry-from-July-6-4<\\/a><\\/p>\"}'),
(198, '2022-09-05 10:42:34', '\\App', '1', NULL, NULL, 'Articles', '4', 'info', 'update', '', '{\"description\":\"<p>Canada will be lifting the last pandemic-era restriction on its immigration services. The country announced that all Express Entry draws will resume starting July 6.<\\/p><p>Canada first imposed restrictions at the start of the pandemic- over 18 months ago.<\\/p><p>Think you check all the immigration boxes? Find out<br><br>Immigration minister Sean Fraser took to Twitter to invite all eligible candidates to apply under<\\/p><p>This comes as a time when the country is already struggling to cope with massive processing delays. According to data shared with ET, Immigration, Refugees and Citizenship Canada (IRCC) had an immigration backlog of almost 2.4 million people, as of June 6, 2022.<br><br>Last month, Canadian Prime Minister Justin Trudeau also announced a new task force to tackle the delays, saying, \\u201cwe know service delays, particularly in recent months, are unacceptable...we will continue to do everything we ca&nbsp;..<br>&nbsp;<\\/p><p><a href=\\\"http:\\/\\/immiyami.mylap\\/pages\\/article-view?page_id=Canada-will-reopen-all-PR-programs-under-Express-Entry-from-July-6-4\\\">http:\\/\\/immiyami.mylap\\/pages\\/article-view?page_id=Canada-will-reopen-all-PR-programs-under-Express-Entry-from-July-6-4<\\/a><\\/p>\"}'),
